met de stemmen van Owen Wilson, Larry The Cable Guy en Bonnie Hunt

De grote ster uit het racecircuit Lightning McQueen en zijn trouwe mecanicien en vriend Mater reizen naar Japan en Europa voor 
hun eerste grote Grand Prix. Maar alsof de snelste auto ter wereld worden nog niet moeilijk genoeg is, raakt Mater betrokken 
bij een internationaal spionagecomplot. Nu moet hij zijn tijd verdelen tussen een geheime spionage-missie en het assisteren van 
Lightning op het circuit.
